import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="cover-container">
        <Header></Header>
      </div>
    );
  }
}

class Header extends Component {
  render() {
    return (
      <div className="masthead mb-auto">

      </div>
    );
  }
}

export default App;
